const showMenu = (toggleId, navId) =>{
  const toggle = document.getElementById(toggleId),
  nav = document.getElementById(navId)

  if(toggle && nav){
      toggle.addEventListener('click', ()=>{
          $('.header-items').slideToggle(300)
      })
  }
}
showMenu('bar-icon','header-items')

// Hover trigger animation
$('.play-group').hover(
  function () {
    $(this).addClass('rotate-animation');
    $('.play-group__play').addClass('remove-animation');
  },
  function () {
    console.log('test')
  }
  );

  // Foot animation
  $(window).scroll(function() {
    let hT = $('.foot-area').offset().top,
        hH = $('.foot-area').outerHeight(),
        wH = $(window).height(),
        wS = $(this).scrollTop() + 100;
    let myImageId = $('#myImageId')[0];
    //  console.log((hT-wH) , wS);
    if (wS < (hT+hH-wH)){
     myImageId.src='./images/foot1.svg';
    }
    if (wS > (hT+hH-wH) && wS < (hT+hH-wH) + 100 ){
      myImageId.src='./images/foot1scroll11.svg';
    }
    if (wS > (hT+hH-wH+100) && wS < (hT+hH-wH+200) ){
      myImageId.src='./images/foot1scroll22.svg';
    }
    if (wS > (hT+hH-wH+200) && wS < (hT+hH-wH+300) ){
      myImageId.src='./images/foot1scroll33.svg';
    }
    if (wS > (hT+hH-wH+300) && wS < (hT+hH-wH+400) ){
      myImageId.src='./images/foot1scroll44.svg';
    }
    if (wS > (hT+hH-wH+400) && wS < (hT+hH-wH+500) ){
      myImageId.src='./images/foot1scroll55.svg';
    }
    if (wS > (hT+hH-wH+500) && wS < (hT+hH-wH+600) ){
      myImageId.src='./images/foot1scroll66.svg';
    }
 });

